HQ promo music video from a promo DVD. &quot;Taken for a Fool&quot; is a song by American rock-band The Strokes. It is the second single for their fourth studio album, Angles, and was released as a 7&quot; vinyl and digital download on July 1, 2011. 

&quot;Taken for a Fool&quot; was confirmed as the second single, which was sent to U.S. radio on May 24, 2011. On June 9, The Strokes announced that a music video for &quot;Taken For a Fool&quot; was in the works, and that it is directed by Laurent Briet. They revealed that the music video should be finished by the end of the month. The Strokes put out the music video for &quot;Taken For a Fool&quot; on July 8, 2011. 

The Strokes are an American rock band from New York, consisting of Julian Casablancas (lead vocals), Nick Valensi (guitar, backing vocals), Albert Hammond, Jr. (guitar, backing vocals), Nikolai Fraiture (bass guitar) and Fabrizio Moretti (drums, percussion). 

Upon the release of their debut album Is This It in 2001, the group met much critical acclaim. Since then, the band has maintained a large fan base all over the world, most notably in the United States, the United Kingdom, Argentina, Canada, France, Brazil and Australia. A number of members have embarked on a variety of side projects, although a fourth album, entitled Angles, was released on March 22, 2011. They are one of the most prominent indie-rock bands to hail from the US at the dawn of the 21st century and helped start the garage rock revival movement. Is This It was ranked number 199 on Rolling Stone's 500 Greatest Albums of All Time. 
